import './App.css';

function App() {
  return (
    <div className="App">
            <nav id="home" class="menu">

                <ul class="menu-links">
                    <li><a href="#about">Como funciona</a></li>
                    <li><a href="#cadastro">Cadastrar</a></li>
                    <li><a href="#faq">FAQ</a></li>
                    <li><a href="#contato">Contato</a></li>
                </ul>

                <ul class="menu-icons">
                    <li><a target="_blank" href="https://facebook.com/"><i class="fa-brands fa-facebook-f"></i></a></li>
                    <li><a target="_blank" href="https://twitter.com/"><i class="fab fa-twitter"></i></a></li>
                    <li><a target="_blank" href="https://youtube.com/"><i class="fa-brands fa-youtube"></i></a></li>
                    <li><a target="_blank" href="https://instagram.com/"><i class="fa-brands fa-instagram"></i></a></li>
                    <li><a href="mailto:oi@gmail.com"><i class="fas fa-envelope"></i></a></li>
                </ul>
            </nav>
    </div>
  );
}

export default App;
